// React
import React, { useState, useEffect } from "react";
import { formatWorkInfoLineStacked } from "./modules/formatWorkDetails";

function PageDateCollections({ works, base, allWorksById }) {
  const [collectionWorks, setCollectionWorks] = useState([]);
  const [isLoading, setIsLoading] = useState(true);
  const [fullScreenIndex, setFullScreenIndex] = useState(undefined);

  useEffect(() => {
    if (Object.keys(allWorksById).length === 0) setIsLoading(true);
    else {
      let _collectionWorks = [];
      works.forEach(function (workId) {
        let workRecord = allWorksById[workId];
        _collectionWorks.push(workRecord);
      });
      setCollectionWorks([..._collectionWorks]);
      setIsLoading(false);
    }
  }, [allWorksById]);

  if (isLoading) return null;

  let imageGrid;
  let fullScreenImage;
  let imageDetails;

  // Show all thumbnails
  if (fullScreenIndex === undefined) {
    imageGrid = (
      <div>
        <div
          style={{
            display: "flex",
            direction: "row",
            flexWrap: "wrap",
            maxWidth: "100%",
            gap: "50px",
            padding: 40,
          }}
        >
          {collectionWorks.map((work, i) => {
            return (
              <div
                style={{ width: "200px", height: "200px", overflow: "hidden" }}
                onClick={() => {
                  setFullScreenIndex(i);
                }}
              >
                <img
                  alt="artwork"
                  style={{
                    width: "300px",
                    height: "300px",
                    marginLeft: "-50px",
                    marginTop: "-50px",
                    objectFit: "cover",
                  }}
                  src={work.imageLink}
                />
              </div>
            );
          })}
        </div>
      </div>
    );
  } else {
    // Show full screen record
    let fullScreenWorkRecord = collectionWorks[fullScreenIndex];

    fullScreenImage = (
      <div
        style={{
          position: "relative",
          display: "flex",
          flex: 1,
          padding: 40,
          paddingLeft: 0,
        }}
        className={"rightArrowOnHover"}
        onClick={() => {
          setFullScreenIndex(
            (fullScreenIndex + 1 + collectionWorks.length) %
              collectionWorks.length
          );
        }}
      >
        <img
          alt="artwork"
          style={{
            height: "100%",
            width: "100%",
            objectFit: "contain",
          }}
          src={fullScreenWorkRecord.imageLink}
        />
      </div>
    );

    // Conditionally generate image details
    // and prev / next buttons
    imageDetails = (
      <div>
        {formatWorkInfoLineStacked(fullScreenWorkRecord)}

        <div
          style={{
            display: "flex",
            flexDirection: "row",
            alignItems: "center",
          }}
        >
          <div
            onClick={() => {
              setFullScreenIndex(
                (fullScreenIndex - 1 + collectionWorks.length) %
                  collectionWorks.length
              );
            }}
            style={{ fontWeight: 600, userSelect: "none" }}
            className={"leftArrowOnHover"}
          >
            prev
          </div>
          <div style={{ marginLeft: 8, marginRight: 8 }}>/</div>
          <div
            onClick={() => {
              setFullScreenIndex(
                (fullScreenIndex + 1 + collectionWorks.length) %
                  collectionWorks.length
              );
            }}
            style={{ fontWeight: 600, userSelect: "none" }}
            className={"rightArrowOnHover"}
          >
            next
          </div>
        </div>
      </div>
    );
  }

  return (
    <div className="collectionPage">
      <div
        style={{
          height: "100%",
          flex: 1,
          display: "flex",
        }}
      >
        <div
          style={{
            padding: 40,
            flex: 1,
            display: "flex",
            justifyContent: "space-between",
            alignItems: "space-between",
            flexDirection: "column",
          }}
        >
          <div>
            <div style={{ fontWeight: 600, marginBottom: 8 }}>YEAR</div>

            {fullScreenIndex !== undefined && (
              <div
                style={{ fontWeight: 600, marginTop: 8, userSelect: "none" }}
                onClick={() => {
                  setFullScreenIndex(undefined);
                }}
              >
                see all
              </div>
            )}
          </div>
          {imageDetails}
        </div>
      </div>
      <div
        style={{
          height: "100%",
          flex: 2,
          display: "flex",
          overflow: "auto",
          WebkitOverflowScrolling: "touch",
        }}
      >
        {fullScreenIndex === undefined ? imageGrid : fullScreenImage}
      </div>
    </div>
  );
}

export default PageDateCollections;
